import { Outlet } from "react-router";
import Table from "react-bootstrap/Table";
function Writelist() {
  return (
    <table>
      <thead>
        <tr>
          <th>번호</th>
          <th>제목</th>
          <th>작성자</th>
          <th>날짜</th>
          <th>조회수</th>
        </tr>
      </thead>
    </table>
  );
}

export default Writelist;
